import Logo from '../../components/sign';

import { images } from '../../constants';
import './Footer.css';

const Footer = () => (
  <div className="footer">
    <div className="footer__top">
      <div className="footer__social-icons">
        <FiFacebook className="footer__icon" />
        <FiInstagram className="footer__icon" />
      </div>
      <p className="footer__contact-info">0541 203 47 66</p>
      <a href="mailto:info@fıstıkezmecim.com" className="footer__contact-info">info@fıstıkezmecim.com</a>
    </div>
    <div className="footer__bottom">
      <div className="footer__logo">
        <Logo />
        <img src={images.logo3} alt="tigerweirdo_img" className="footer__logo-image" />
      </div>
      </div>
      <div className="footer__copyright">
        <p className="footer__copyright-text">© JustNut, 2023</p>
      </div>
    </div>

);

export default Footer;
